descriptions:
ДК "Атамари" - это маленький, уютный домик. Он наполнен ароматами тепла и нежности. Построенный с любовью, ДК "Атамари" согревает своих владельцев в самые холодные зимы и спасает от самого сильного дождя. 
Фундамент: свайно-винтовой.
Домокоплект: полный СИП.
Кровля: гибкая черепица. 
Окна: ПВХ 58й профиль, двухкамерный стеклопакет. 
Входная дверь: металлическая. 
Планировка: Тамбур - 2м2;
                           с/у совмещенный - 3,6м2;
                           Кухня-гостинная - 19,7м2;
                           Вспомагательное помещение - 7,7м2;
                           Комната 1 - 8,4м2;
                           Холл - 6,1м2.
Лестница - черновая.
Внутренняя отделка - отсутствует.
Инженерные коммуникации - отсутствуют.
Фасадная отделка - отсутствует.

Небольшой дом для семьи из 2 человек. Бюджетный вариант жилой планировки, минимальная стоимость.

Фундамент: буронабивные сваи, ленточный монолитный ростверк;
Перекрытия фундамента: монолитная плита;
Перекрытие межэтажное: деревянные балки;
Чердачное перекрытие: деревянные балки 200 мм, минеральная вата 200 мм;
Стены: газоблок 300 мм, облицовочный кирпич, облицовочный искусственный камень;
Кровля: деревянные стропила, металлочерепица, водосточная система, подшив – софиты;
Перегородки: газоблок, гипсокартонные перегородки на металлических профилях;
Окна и двери: пластиковые двухкамерные стеклопакеты, входная дверь металлическая;
Коммуникации: закладные элементы канализации и водоснабжения.

Несущий каркас дома: завальцованная доска камерной сушки 45*195 мм;
Отделка фасада: имитация бруса, заводская покраска Teknos;
Ветрозащита: Изоплат 12 мм;
Кровля: металлочерепица Grand Line 0,5 мм;
Отделка свесов кровли: строганная доска камерной сушки, заводская покраска Teknos;
Окна ПВХ Veka/Rehau, 70 мм;
Входная дверь: JELD-Wen (Финляндия);

При необходимости архитектор внесет изменения в проект под ваши вкусы и задачи, не снижая эксплуатационных характеристик дома.

