Стены: газоблок 300 мм, облицовочный кирпич, облицовочный искусственный камень;
Кровля: деревянные стропила, металлочерепица, водосточная система, подшив – софиты;
Перегородки: газоблок, гипсокартонные перегородки на металлических профилях;
