Одноэтажный жилой дом 10*12 из бруса
 Фундамент ленточный / сваи 150х150мм (рассчитывается после выезда на участок);
 Гидроизоляция фундамента рубероидом;
 Антисептирование закладочного венца;
 Cтены дома из бруса 180х180 мм.; 
Используются шканты диаметром 32 мм и влажностью не более 12%; 
Углы дома в ласточкин хвост (тёплый угол); 
Межвенцовый утеплитель. Джут – натуральное экологически чистое волокно;
 Оконные и дверные колоды – брус 100х180; Балки пола и потолка - брус 100х180 мм;
 Полы и потолок - доска 150х40 (пол), 150х25 (потолок); Капитальные, внутренние стены – брус 100х180 мм., согласно проекту и заключенному договору; 
Стропильная система – доска 150х40 мм., Обрешетка – доска 150х25 мм; 
Кровля металлочерепица. Возможен монтаж ондулина, профлиста, гибкой черепицы; 
Карнизы и фронтоны– доска 150х25 мм; Доставка материала на объект заказчика; 
Расходные материалы – шканты, гвозди, скобы, антисептик и т.д.; 
Охрана материала на объекте Заказчика; Монтаж дома "под крышу"; 
Тип фундамента и его стоимость рассчитывается отдельно, после выезда специалиста на участок Заказчика.

Одноэтажный дом в стиле фахверк с полезной площадью 42 м² — это уютное и функциональное пространство для вашей семьи. В доме есть:
студия, которая может служить гостиной и столовой;
парная для отдыха и релаксации;
техническое помещение для хранения вещей или установки оборудования;
прихожая, где можно оставить верхнюю одежду и обувь.
Дом фахверк — это стильный и современный выбор для вашего дома!

Проект уютного дома на 55 м²

• Тщательно продуманная планировка: просторная гостиная, совмещенная со светлой кухней (откуда предусмотрен дополнительный выход во двор или на собственную террасу), уютные спальная и детская комнаты, свободная прихожая и удобная ванная комната;
• Снаружи дом оснащен фасадными светильниками, яркой карнизной подсветкой по периметру и удобным входным крыльцом

Особенности дома:
Одноэтажный дом с мансардой;
Три спальни;
Выход на террасу из гостиной;
Два санузла, обособленное помещение для котельной;

При необходимости архитектор внесет изменения в проект под ваши вкусы и задачи, не снижая эксплуатационных характеристик дома.

К преимуществам минимализма можно отнести такие качества:
наличие свободного пространства в комнатах;
психологическая разгрузка;
продуманный дизайн;
простота уборки;
легкость ремонта.

Планировкой предусмотрены: кухня с доступом в техническое помещение/кладовую, столовая-гостиная с выходом на террасу, три спальни, два санузла,

Площадь дома - 90 м2.

Планировка:
• 3 раздельные спальные комнаты;
• Уютная кухня-гостиная с  выходом на заднюю часть участка;
• Раздельный санузел;
• Просторный холл с нишей под гардеробный шкаф-купе;
• Входной тамбур;
• Терраса.

