• Фундамент: монолитно - ленточный. Единый каркас из арматуры.
• Цоколь: полнотелый цокольный СКЦ блок.
• Стены: керамзитобетонный блок 200 мм+ утеплитель 100 мм + облицовочный кирпич.
• Крыша: металлочерепица + качественная водосточная система, паро- и гидроизоляционная плёнка.
• Потолок: минеральное утепление потолка производится механизированным способом (150 мм).
• Окна: ПВХ, энергоэффективный двойной стеклопакет (3 стекла).

