Технология Prefab
Дома производятся в заводских условиях.
Строительство не зависит от погодных условий, а строительный материал не подвергаются агрессивному воздействую окружающей среды. Дома подходят для круглогодичного проживания. 
ЧИСТОВАЯ ОТДЕЛКА

Утепление стен 150+50мм. (Материал внутреннего утеплителя экологичный, с гипоаллергенными свойствами);
Утепление пола и потолка 200+50мм. (Материал внутреннего утеплителя экологичный, с гипоаллергенными свойствами);
