Розетки и выключатели Onekey Florece;
Светильники накладные точечные;
Тёплый пол в каждом помещении;
Разводка ПВХ труб холодной и горячей воды;
Инсталляция Santek с унитазом;
Водонагреватель на 100 литров.
Интерьер представлен в двух цветовых решениях: белёный дуб или антрацит-белёный дуб.

