— современный фасад выполнен из декоративной штукатурки и ригельной плитки ручной формовки;
— наружные стены: крупноформатный блок Роrоthеrm 250 мм, утеплитель толщиной 150 мм; 
— железобетонные плиты перекрытия толщиной 220 мм;
— панорамные окна, благодаря которым в комнатах будет много естественного света;
— эргономичные планировки позволяют расставить мебель по вашему предпочтению;
— высокие потолки создают ощущения легкости и простора.

Все дома строятся согласно стандартам ГОСТ и СНиП. За качество отвечаем 5-летней гарантией.

Функциональный двухэтажный дом с гаражом для автомобиля и большими террасами для проведения уютных вечеров на воздухе большой семьей.

О проекте дома и используемых материалах:
— просторные комнаты и террасы общей площадью 272,61 кв.м.;
— современный фасад выполнен из декоративной штукатурки и ригельной плитки ручной формовки;
— кровля: железобетонные плиты перекрытия, гидропароизоляция, экструдированный пенополистирол толщиной 150мм, разуклонка керамзит ПВХ мембрана 1,2 мм, система внутреннего водостока;
— наружные стены: крупноформатный блок Роrоthеrm 250 мм, утеплитель толщиной 150 мм; 
— железобетонные плиты перекрытия толщиной 220 мм;
— панорамные окна, благодаря которым в комнатах будет много естественного света;
— эргономичные планировки позволяют расставить мебель по вашему предпочтению;
— высокие потолки создают ощущения легкости и простора.

Проект двухэтажного дома:
- фундамент: железобетонный;
- стены и внутренние перегородки: каркасные, ГКЛ;
- фасад: фасадные панели kmew или аналог
- оконные и дверные конструкции: кашированный ПВХ профиль;
- кровельное покрытие: фальц;
- первичная отделка внутренних помещений: напольная цементно-песчаная стяжка;
- лестница на второй этаж: металлический каркас;
- терраса: каркас по уплотненному основанию или на усмотрение Продавца металлические винтовые сваи 
- инженерные сети: водоснабжение от централизованной системы, с выводами в санузлах и на кухне; канализация (септик из 2 железобетонных колодцев с системой перелива) с выводами в санузлах и на кухне; отопление газовое с установкой системы теплого пола на первом и втором этаже, электроснабжение трехфазное 380 В (выделяемая мощность на домовладение – 11,5 кВт), заведенные оптиковолоконные сети с установкой оптической розетки в техническом помещении..

После окончания строительства жилого дома Заказчику будет передано установленное оборудование в составе:
- одноконтурный газовый котел мощностью 24 кВт;
- прибор учета газа;
- прибор учета электроэнергии, установленный в уличном распределительном шкафу;
- прибор учета воды;
- система отопления теплого пола.

Дом в Живописном.

430 м² дома продуманы до мелочей:
🔹 большая кухня, 2 террасы (крытая и открытая) специально спроектированы в доме, чтобы принимать гостей и проводить время за столом;
🔹 вместительный гараж на 4 машины, чтобы все члены семьи могли парковать машины в тепле;
🔹 4 просторные спальни на втором этаже, 2 из которых выходят окнами на лес имеют помещения гардеробных;
🔹 отдельная кладовая и эргономичная прачечная говорят о трудолюбии хозяек дома;
🔹 банный комплекс на первом этаже служит местом отдыха в самом доме, чтобы никуда отдельно не выезжать, для полноценного отдыха.

☝🏼А фасад этого замечательного дома просто невероятно красив: сочетание ригельного кирпича и декоративных вертикальных ламелей «под дерево» выглядят очень респектабельно.

Наши преимущества:

• Предоставляем доступ к видеотрансляции онлайн 24/7 с камер на Вашем строительном участке;
• Соблюдаем технологии и ГОСТы, в первую очередь работая на качество;
• Приветствуем участие инженера технического надзора;
• Возьмем БЕСПЛАТНО на себя всю бюрократию по документообороту на регистрацию и подключение инженерных сетей;
• Имеем опыт в строительстве более 12 лет;
• Организуем благоустройство Вашего участка (отмостка, дорожки, озеленение, орошение, освещение, видеонаблюдение);
• Даём 5 лет гарантии на нашу работу.

Звонки принимаем с понедельника по воскресенье с 9:00 - 20:00, сообщения -круглосуточно.

